import React from 'react';

const CardJobs = ({title, description}) => {
    return(
        <div className="card-jobs col-xs-3">
            <div className="card-jobs-body">
                <div className="card-jobs-title text-secondary">{title}</div>
                <div className="card-jobs-description text-note-secondary">{description}</div>
            </div>
        </div>
    );
};

export default CardJobs;
